import React from 'react';
import { Image, StyleSheet, SafeAreaView } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center', // supaya gambar di tengah horizontal
    justifyContent: 'center', // supaya gambar di tengah vertical
    backgroundColor: '#fff',
  },
  tinyLogo: {
    width: 50,
    height: 50,
    marginBottom: 10,
  },
  logo: {
    width: 66,
    height: 58,
  },
});

const DisplayAnImage = () => (
  <SafeAreaView style={styles.container}>
    {/* Gambar dari local asset (pastikan file ada di folder assets/logo.png) */}
    <Image
      style={styles.tinyLogo}
      source={require('./assets/logo.jpg')}
    />

    {/* Gambar dari internet */}
    <Image
      style={styles.tinyLogo}
      source={{
        uri: 'https://reactnative.dev/img/tiny_logo.png',
      }}
    />

    {/* Gambar dari base64 */}
    <Image
      style={styles.logo}
      source={{
        uri: 'data:image/png;base64,',
      }}
    />
  </SafeAreaView>
);

export default DisplayAnImage;
